import logo from './component/Logo-UKS-Usaha-Kesehatan-Sekolah-Warna.png';
import './App.css';

function App() {
  return (
    <div className="w-full h-screen flex justify-center items-center bg-gray-300">
      <div className={`bg-white w-1/2 text-black rounded-2xl flex flex-col`}>
        <div className={`flex justify-center`}>
          <img src={logo} alt="Logo" className={``}/>
        </div>
      </div>
    </div>
  );
}

export default App;
